}

export const NavBar = () => {

    const links = ['lala', "toto", "test"]

    return (
        <div className='h-[64px] sticky top-0 z-20 w-full border-b bg-white flex items-center px-28'>
                <h1 className="font-semibold text-gray-800">HEADER</h1>
            <div className="flex space-x-6">
                {
                    links.map((link, key) => {
                        return <p>{link}</p>
                    })
                }
            </div>
        </div>
    )
}
